import{_ as e,a,b as i,c as o}from"./chunks/thermal_calibration_baro.BAbPqO8O.js";import{_ as c,c as r,o as l,ab as t}from"./chunks/framework.CUflZczI.js";const b=JSON.parse('{"title":"Термальне калібрування та компенсація","description":"","frontmatter":{},"headers":[],"relativePath":"uk/advanced_config/sensor_thermal_calibration.md","filePath":"uk/advanced_config/sensor_thermal_calibration.md"}'),d={name:"uk/advanced_config/sensor_thermal_calibration.md"},s=t('<h1 id="термальне-калібрування-та-компенсація" tabindex="-1">Термальне калібрування та компенсація <a class="header-anchor" href="#термальне-калібрування-та-компенсація" aria-label="Permalink to &quot;Термальне калібрування та компенсація&quot;">​</a></h1><p>PX4 містить функцію калібрування та компенсації акселерометра, гіроскопа, магнітометра та датчиків барометричного тиску для впливу зміни температури датчика на зміщення датчика.</p><p>Ця тема розглядає <a href="#test_setup">середовище тестування</a> та <a href="#calibration_procedures">процедури калібрування</a>. В кінці надається опис <a href="#implementation">впровадження</a>.</p><div class="info custom-block"><p class="custom-block-title">Після термокалібрування параметри термокалібрування (<code>TC_*</code>) використовуються для <em>всієї</em> калібрування/компенсації відповідних датчиків. Отже, будь-яке наступне стандартне калібрування оновить параметри <code>TC_*</code>, а не &quot;звичайні&quot; параметри калібрування <code>SYS_CAL_*</code> (і в деяких випадках ці параметри можуть бути скинуті).</p></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Випуски до PX4 v1.14 не підтримують термокалібрування магнітометра.</p></div><p><a id="test_setup"></a></p><h2 id="тестування-налаштувань-та-наикращі-практики" tabindex="-1">Тестування налаштувань та найкращі практики <a class="header-anchor" href="#тестування-налаштувань-та-наикращі-практики" aria-label="Permalink to &quot;Тестування налаштувань та найкращі практики&quot;">​</a></h2><p><a href="#calibration_procedures">Процедури калібрування</a>, описані в наступних розділах, ідеально виконувати в <em>камері для навколишнього середовища</em> (середовищі з контрольованою температурою та вологістю), оскільки плата нагрівається від найнижчої до найвищої робочої/ температура калібрування. Перед початком калібрування плату спочатку <em>замочують</em> (охолоджують до мінімальної температури та дають їй досягти рівноваги).</p><p>:::note Активні електронагрівальні елементи впливатимуть на значення калібрування магнітометра. Переконайтеся, що нагрівальні елементи або неактивні, або достатньо далеко від датчика, щоб уникнути введення шуму в калібрування магнітометра. :::</p><p>Для заморожування можна використовувати звичайну домашню морозильну камеру для досягнення температури -20°C, а комерційні морозильні камери можуть досягати температури приблизно -40°C. Дошку слід помістити в пакет з антистатичної плівки або замкнуту у спеціальну сумку з силікагелем, з проводом живлення, який виходить через герметично закриту отвір. Після заморожування пакет можна перемістити до тестового середовища, і тест можна продовжити в тому ж пакеті.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Мішок / силіка слугує для запобігання конденсації на платі.</p></div><p>Так, можливо провести калібрування без камери комерційного класу. Можна створити простий контейнер для середовища, використовуючи пінопластову коробку з дуже малим внутрішнім об&#39;ємом повітря. Це дозволяє автопілоту самостійно нагрівати повітря досить швидко (переконайтеся, що коробка має невелике отвірчик, щоб вирівняти тиск з оточуючим повітрям, але все ж може нагрітися всередині).</p><p>За допомогою такого типу установки можна нагріти плату приблизно до 70 °C. Анекдотичні дані свідчать, що багато поширених плат можна нагріти до цієї температури без негативних побічних ефектів. Якщо у вас є сумніви, перевірте безпечний діапазон роботи у виробника.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Щоб перевірити статус калібрування вбудованої термічної системи, скористайтеся консоллю MAVlink (або консоллю NuttX), щоб перевірити звітовану внутрішню температуру від датчика.</p></div><p><a id="calibration_procedures"></a></p><h2 id="принципи-калібрування" tabindex="-1">Принципи калібрування <a class="header-anchor" href="#принципи-калібрування" aria-label="Permalink to &quot;Принципи калібрування&quot;">​</a></h2><p>PX4 підтримує два процедури калібрування:</p><ul><li><a href="#onboard_calibration">onboard</a> - калібрування запускається на самій платі. Цей метод вимагає знань про те, наскільки можливе підвищення температури з використанням тестового устаткування.</li><li><a href="#offboard_calibration">offboard</a> - компенсаційні параметри обчислюються на розробницькому комп&#39;ютері на основі інформації журналу, зібраної під час процедури калібрування. Цей метод дозволяє користувачам візуально перевіряти якість даних та підгонку кривої.</li></ul><p>Підхід offboard є складнішим і повільнішим, але вимагає менше знань про тестове обладнання і є легше перевірити.</p><p><a id="onboard_calibration"></a></p><h3 id="процедура-калібрування-на-борті" tabindex="-1">Процедура калібрування на борті <a class="header-anchor" href="#процедура-калібрування-на-борті" aria-label="Permalink to &quot;Процедура калібрування на борті&quot;">​</a></h3><p>Онбордне калібрування виконується повністю на пристрої. Для цього потрібно мати уявлення про те, наскільки можна підвищити температуру за допомогою тестового обладнання.</p><p>Для проведення калібрування на борту виконайте такі кроки:</p><ol><li>Переконайтеся, що тип рами встановлено перед калібруванням, інакше параметри калібрування будуть втрачені, коли плата буде налаштована.</li><li>Увімкніть плату та встановіть параметри <code>SYS_CAL_*</code> на значення 1, щоб увімкнути калібрування потрібних датчиків при наступному запуску. [^1]</li><li>Встановіть параметр <a href="./../advanced_config/parameter_reference.html#SYS_CAL_TDEL">SYS_CAL_TDEL</a> на кількість градусів підвищення температури, необхідну для завершення вбудованого калібратора. Якщо цей параметр занадто малий, калібрування завершиться рано, і діапазон температур для калібрування не буде достатнім для компенсації при повному нагріванні плати. Якщо цей параметр встановлено занадто великим, вбудований калібратор ніколи не завершиться. При встановленні цього параметра слід враховувати підвищення температури через самонагрівання плати. Якщо кількість підвищення температури на датчиках невідома, то слід використовувати метод калібрування поза межами плати. Якщо цей параметр встановлено занадто великим, вбудований калібратор ніколи не завершиться. при встановленні цього параметра слід враховувати підвищення температури через самонагрівання плати. Якщо кількість підвищення температури на датчиках невідома, то слід використовувати метод калібрування поза межами плати.</li><li>Встановіть параметр <a href="./../advanced_config/parameter_reference.html#SYS_CAL_TMIN">SYS_CAL_TMIN</a> на найнижчу температуру даних, яку ви хочете, щоб калібратор використовував. Це дозволяє використовувати більш низьку початкову амбієнтну температуру для зменшення часу охолодження, зберігаючи при цьому контроль над мінімальною температурою калібрування. Дані для датчика не будуть використані калібратором, якщо вони будуть нижчими, ніж значення, встановлене цим параметром.</li><li>Встановіть параметр <a href="./../advanced_config/parameter_reference.html#SYS_CAL_TMAX">SYS_CAL_TMAX</a> на найвищу початкову температуру датчика, яка повинна бути прийнята калібратором. Якщо початкова температура вища, ніж значення, встановлене цим параметром, калібрування завершиться з помилкою. Зверніть увагу, що якщо відхилення виміряної температури між різними датчиками перевищує різницю між <code>SYS_CAL_TMAX</code> і <code>SYS_CAL_TMIN</code>, то буде неможливо розпочати калібрування.</li><li>Вимкніть живлення та охолодіть плату до температури нижче початкової, визначеної параметром <code>SYS_CAL_TMIN</code>. Зауважте, що перед початком калібрування існує 10-секундна затримка під час запуску, щоб дозволити будь-яким датчикам стабілізуватися, і датчики будуть нагріватися всередині протягом цього періоду.</li><li>Тримаючи плату в нерухомому стані[^2], увімкніть живлення та нагрійте її до достатньо високої температури, щоб досягти підвищення температури, визначеного параметром <code>SYS_CAL_TDEL</code>. Відсоток виконання друкується на системній консолі під час калібрування. [^3]</li><li>Вимкніть живлення та залиште плату для охолодження до температури, яка знаходиться в межах діапазону калібрування, перш ніж виконати наступний крок.</li><li>Виконайте калібрування акселерометра за допомогою консолі системи за допомогою команди <code>commander calibrate accel</code> або через <em>QGroundControl</em>. Якщо плата встановлюється вперше, також потрібно виконати калібрування гіроскопа та магнітомера.</li><li>Після калібрування датчиків до політів завжди потрібно перезавантажити плату, оскільки раптові зміни зміщень від калібрування можуть спотворити навігаційний оцінювач, і деякі параметри не завантажуються алгоритмами, які використовують їх, до наступного запуску.</li></ol><p><a id="offboard_calibration"></a></p><h3 id="процедура-позабортового-калібрування" tabindex="-1">Процедура позабортового калібрування <a class="header-anchor" href="#процедура-позабортового-калібрування" aria-label="Permalink to &quot;Процедура позабортового калібрування&quot;">​</a></h3><p>Виносне калібрування виконується на комп’ютері розробки з використанням даних, зібраних під час випробування калібрування. Виносне калібрування виконується на комп’ютері розробки з використанням даних, зібраних під час випробування калібрування.</p><p>Щоб виконати автономне калібрування:</p><ol><li><p>Переконайтеся, що тип кадру встановлено перед калібруванням, інакше параметри калібрування будуть втрачені під час налаштування плати.</p></li><li><p>Увімкніть плату та встановіть параметри <a href="./../advanced_config/parameter_reference.html#TC_A_ENABLE">TC_A_ENABLE</a>, <a href="./../advanced_config/parameter_reference.html#TC_B_ENABLE">TC_B_ENABLE</a>, <a href="./../advanced_config/parameter_reference.html#TC_G_ENABLE">TC_G_ENABLE</a> і <a href="./../advanced_config/parameter_reference.html#TC_M_ENABLE">TC_M_ENABLE</a> на <code>1</code>.</p></li><li><p>Встановіть всі параметри <a href="./../advanced_config/parameter_reference.html#CAL_ACC0_ID">CAL_ACC*</a>, <a href="./../advanced_config/parameter_reference.html#CAL_GYRO0_ID">CAL_GYRO*</a>, <a href="./../advanced_config/parameter_reference.html#CAL_MAG0_ID">CAL_MAG*</a>, and <a href="./../advanced_config/parameter_reference.html#CAL_BARO0_ID">CAL_BARO*</a> на значення за замовчуванням.</p></li><li><p>Установіть для параметра <a href="./../advanced_config/parameter_reference.html#SDLOG_MODE">SDLOG_MODE</a> значення 2, щоб увімкнути реєстрацію даних під час завантаження.</p></li><li><p>Установіть прапорець <a href="./../advanced_config/parameter_reference.html#SDLOG_PROFILE">SDLOG_PROFILE</a> для <em>термічного калібрування</em> (біт 2), щоб зареєструвати необроблені дані датчика, необхідні для калібрування.</p></li><li><p>Охолодіть дошку до мінімальної температури, при якій вона буде потрібна для роботи.</p></li><li><p>Увімкніть живлення та тримайте плату нерухомо [^2], повільно нагрійте її до максимальної необхідної робочої температури. [^3]</p></li><li><p>Вимкніть живлення та розпакуйте файл .ulog.</p></li><li><p>Відкрийте вікно терміналу в каталозі <strong>Firmware/Tools</strong> і запустіть сценарій калібрування python:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">python</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> process_sensor_caldata.py</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> &lt;</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">full</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> path</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> name</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> to</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> .ulog</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> fil</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">e</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">&gt;</span></span></code></pre></div><p>Буде створено файл <strong>.pdf</strong>, у якому відображатимуться вимірювані дані та підгонка кривої для кожного датчика, а також файл <strong>.params</strong>, що містить параметри калібрування.</p></li><li><p>Увімкніть плату, підключіть <em>QGroundControl</em> та завантажте параметри зі створеного файлу <strong>.params</strong> на плату за допомогою <em>QGroundControl</em>. Відсоток виконання друкується на системній консолі під час калібрування.</p></li><li><p>Після завершення завантаження параметрів встановіть для параметра <code>SDLOG_MODE</code> значення 1, щоб знову ввімкнути звичайне журналювання та вимкнути живлення.</p></li><li><p>Увімкніть плату та виконайте звичайне калібрування датчика акселерометра за допомогою <em>QGroundControl</em>. Важливо, щоб цей крок було виконано, коли плата знаходиться в межах діапазону температури калібрування. Після цього кроку плата повинна бути знову увімкнена перед польотом, оскільки раптові зміни зміщення можуть налякати оцінювач навігації, і деякі параметри не завантажуються алгоритмами, що використовують їх, до наступного запуску.</p></li></ol><p><a id="implementation"></a></p><h2 id="деталі-реалізаціі" tabindex="-1">Деталі реалізації <a class="header-anchor" href="#деталі-реалізаціі" aria-label="Permalink to &quot;Деталі реалізації&quot;">​</a></h2><p>Калібрування відноситься до процесу зміни датчиків через діапазон внутрішніх температур, і виконання полінома відповідно до даних для обчислення набору коефіцієнтів (збережених як параметри), що може бути використане для виправлення даних датчика. Компенсація відноситься до процесу використання внутрішньої температури для обчислення зсуву, яке віднімається від читача датчика для виправлення температури</p><p>Зміщення датчиків акселерометра, гірометра обчислюється, використовуючи многочлен третього порядку, тоді як зсув з барометричного тиску розраховується з використанням многочлена 5-го порядку. Приклад переходів відображається нижче:</p><p><img src="'+e+'" alt="Thermal calibration accel"></p><p><img src="'+a+'" alt="Thermal calibration gyro"></p><p><img src="'+i+'" alt="Thermal calibration mag"></p><p><img src="'+o+'" alt="Thermal calibration barometer"></p><h3 id="зберігання-параметрів-калібрування" tabindex="-1">Зберігання параметрів калібрування <a class="header-anchor" href="#зберігання-параметрів-калібрування" aria-label="Permalink to &quot;Зберігання параметрів калібрування&quot;">​</a></h3><p>З існуючою реалізацією системи параметрів ми обмежені збереженням кожного значення в структурі як окремого запису. Щоб обійти це обмеження, для <a href="./../advanced_config/parameter_reference.html#thermal-compensation">параметрів теплової компенсації</a> використовується така логічна домовленість про найменування:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">TC_[type][instance]_[cal_name]_[axis]</span></span></code></pre></div><p>Де:</p><ul><li><p><code>тип</code>: один символ, що вказує на тип датчика, де <code>A</code> = акселерометр, <code>G</code> = швидкість гіроскопа, <code>M</code> = магнітометр і <code>B</code> = барометр.</p></li><li><p><code>екземпляр</code>: ціле число 0, 1 або 2, що дозволяє калібрувати до трьох датчиків одного <code>типу</code>.</p></li><li><p><code>cal_name</code>: це рядок, що ідентифікує значення калібрування. Він має такі можливі значення:</p><ul><li><code>Xn</code>: поліноміальний коефіцієнт, де n є порядком коефіцієнта, напр. <code>X3 * (температура - контрольна температура)**3</code>.</li><li><code>SCL</code>: коефіцієнт масштабування.</li><li><code>TREF</code>: контрольна температура (град. C).</li><li><code>TMIN</code>: мінімальна допустима температура (градус C).</li><li><code>TMAX</code>: максимальна допустима температура (градус C).</li></ul></li><li><p><code>вісь</code>: це ціле число 0, 1 або 2, яке вказує на те, що дані калібрування стосуються осі X, Y або Z у системі відліку плати. Для датчика барометричного тиску суфікс <code>axis</code> опущено.</p></li></ul><p>Приклади:</p><ul><li><a href="./../advanced_config/parameter_reference.html#TC_A1_TREF">TC_A1_TREF</a> – еталонна температура для другого акселерометра.</li><li><a href="./../advanced_config/parameter_reference.html#TC_G0_X3_0">TC_G0_X3_0</a> – це коефіцієнт <code>^3</code> для першої осі x гіроскопа.</li></ul><h3 id="використання-параметрів-калібрування" tabindex="-1">Використання параметрів калібрування <a class="header-anchor" href="#використання-параметрів-калібрування" aria-label="Permalink to &quot;Використання параметрів калібрування&quot;">​</a></h3><p>Корекція теплового зсуву (за допомогою параметрів калібрування) виконується в <a href="./../modules/modules_system.html#sensors">модулі датчиків</a>. Еталонна температура віднімається від виміряної температури, щоб отримати дельта-температуру, де:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>delta = measured_temperature - reference_temperature</span></span></code></pre></div><p>Потім дельта-температура використовується для розрахунку зсуву, де:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>offset = X0 + X1*delta + X2*delta**2 + ... + Xn*delta**n</span></span></code></pre></div><p>Зсув і температурний масштабний коефіцієнт потім використовуються для корекції вимірювання датчика, де:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>corrected_measurement = (raw_measurement - offset) * scale_factor</span></span></code></pre></div><p>Якщо температура перевищує тестовий діапазон, установлений параметрами <code>*_TMIN</code> і <code>*_TMAX</code>, тоді виміряна температура буде обрізана, щоб залишатися в межах.</p><p>Корекція даних акселерометра, гіроскопа, магнітометра або барометра вмикається, налаштувавши <a href="./../advanced_config/parameter_reference.html#TC_A_ENABLE">TC_A_ENABLE</a>, <a href="./../advanced_config/parameter_reference.html#TC_G_ENABLE">TC_G_ENABLE</a>, <a href="./../advanced_config/parameter_reference.html#TC_M_ENABLE">TC_M_ENABLE</a> або <a href="./../advanced_config/parameter_reference.html#TC_B_ENABLE">TC_B_ENABLE</a> параметри до 1 відповідно.</p><h3 id="сумісність-зі-старими-параметрами-cal-та-калібрування-керовані-commander" tabindex="-1">Сумісність зі старими параметрами <code>CAL_*</code> та калібрування, керовані commander <a class="header-anchor" href="#сумісність-зі-старими-параметрами-cal-та-калібрування-керовані-commander" aria-label="Permalink to &quot;Сумісність зі старими параметрами `CAL_*` та калібрування, керовані commander&quot;">​</a></h3><p>Застаріле калібрування гіроскопа й датчика акселерометра PX4 із температурним агностиком виконується модулем керування та передбачає налаштування зміщення, а у випадку калібрування акселерометра — параметрів калібрування масштабного коефіцієнта. Параметри зсуву та масштабного коефіцієнта застосовуються в драйвері для кожного датчика. Ці параметри знаходяться в <a href="./../advanced_config/parameter_reference.html#sensor-calibration">групі параметрів CAL</a>.</p><p>Калібрування бортової температури контролюється модулем подій, а виправлення застосовуються в модулі датчиків перед тим, як буде опубліковано тему комбінованого датчика uORB. Це означає, що якщо використовується термокомпенсація, для всіх відповідних попередніх параметрів зміщення та масштабного коефіцієнта потрібно встановити значення за замовчуванням нуль і одиницю перед виконанням теплового калібрування. Якщо виконується вбудоване калібрування температури, це буде зроблено автоматично, однак якщо виконується зовнішнє калібрування, важливо, щоб застарілі параметри <code>CAL*OFF</code> і <code>CAL*SCALE</code> параметри потрібно скинути перед реєстрацією даних калібрування.</p><p>Якщо термокомпенсацію прискорення було ввімкнено шляхом встановлення параметра <code>TC_A_ENABLE</code> на 1, тоді контрольоване 6-точковим калібруванням прискорення все ще можна виконати. Однак замість налаштування параметрів <code>*OFF</code> і <code>*SCALE</code> у групі параметрів <code>CAL</code> ці параметри встановлюються за замовчуванням, а теплова компенсація &lt; Натомість налаштовуються параметри <code>X0</code> та <code>SCL</code>.</p><p>Якщо теплову компенсацію гіроскопа було ввімкнено шляхом встановлення параметра <code>TC_G_ENABLE</code> на 1, тоді контрольоване калібрування гіроскопа, кероване командиром, усе ще можна виконувати, однак воно використовуватиметься для зміщення кривої компенсації вгору або вниз на необхідну величину до нуля зміщення кутової швидкості. Це досягається шляхом регулювання коефіцієнтів X0.</p><p>Якщо термокомпенсацію магнітометра було ввімкнено шляхом установлення параметра <code>TC_M_ENABLE</code> на 1, тоді контрольоване 6-точковим калібруванням прискорення все ще можна виконати. Однак замість налаштування параметрів <code>*OFF</code> і <code>*SCALE</code> у групі параметрів <code>CAL</code> ці параметри встановлюються за замовчуванням, а теплова компенсація &lt; Натомість налаштовуються параметри <code>X0</code> та <code>SCL</code>.</p><h3 id="обмеження" tabindex="-1">Обмеження <a class="header-anchor" href="#обмеження" aria-label="Permalink to &quot;Обмеження&quot;">​</a></h3><p>Припустимо, що масштабні фактори незмінні температури внаслідок труднощів, пов&#39;язаних з вимірюванням їх за різних температур. Це обмежує корисність калібрування акселерометра в цих сенсорних моделях з факторами стабільного масштабу. Виносне калібрування виконується на комп’ютері розробки з використанням даних, зібраних під час випробування калібрування. Через складність інтеграції необхідного руху дошки з алгоритмом калібрування ця можливість не включена.</p><hr><p>[^1]: Параметри <a href="./../advanced_config/parameter_reference.html#SYS_CAL_ACCEL">SYS_CAL_ACCEL</a>, <a href="./../advanced_config/parameter_reference.html#SYS_CAL_BARO">SYS_CAL_BARO</a> та <a href="./../advanced_config/parameter_reference.html#SYS_CAL_GYRO">SYS_CAL_GYRO</a> скидаються до 0 після початку калібрування. [^2]: Для калібрування зсувів датчика барометричного тиску потрібен стабільний тиск повітря. Тиск повітря змінюватиметься повільно через погоду, а всередині будівель може швидко змінюватися через коливання зовнішнього вітру та роботу системи ОВК. [^3]: Слід бути обережним під час нагрівання холодної дошки, щоб уникнути утворення конденсату на дошці, який за певних обставин може спричинити її пошкодження.</p>',63),n=[s];function p(_,h,m,f,C,u){return l(),r("div",null,n)}const k=c(d,[["render",p]]);export{b as __pageData,k as default};
